import React, { Component } from 'react';
import { Router } from '@reach/router';
import './App.css';
import Header from './Components/Header';
import Hottest from './Components';
import Users from './Components/Users';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Router>
          <Users />
        </Router>
      </div>
    );
  }
}

export default App;
